import prod1 from 'C:/Users/Rodrigo/Desktop/OFTRANCE/app-of-trance/assets/prod1.png';
import prod2 from 'C:/Users/Rodrigo/Desktop/OFTRANCE/app-of-trance/assets/prod2.png';

const colecao  = {
    topo: {
        titulo: 'ॐ RAVESTORE TESTE'
    },
    detalhes: {
        desc1: 'Confecção à mão | Totalmente singular',
        desc2: '- Roupas a pronta entrega e encomendas',
        desc3: '- Aceitamos cartão |  boleto | TED',
        desc4: '- Entregas no metrô & correios'
    },
    produtos: {
        titulo: 'Produtos à venda',
        produtos: [
            { 
                nome: 'macacão1', 
                imagem: prod1
            },
            { 
                nome: 'macacão2', 
                imagem: prod2
            },
        ]
    }
}

export default colecao;
